INSERT INTO `procedures` VALUES (1,'acr5','Bad;Poor;Fair;Good;Excellent',10000,0,1,0,'In this experiment, you will see some pictures on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see the sequence once for a fixed time. After that, you should judge its quality by using one of the five levels of the following scale: 0x0A0x0A 5 Excellent 0x0A 4 Good 0x0A 3 Fair 0x0A 2 Poor 0x0A 1 Bad 0x0A'),(2,'acr11-hr',' ;Bad; ;Poor; ;Fair; ;Good; ;Excellent; ',10000,0,1,1,'In this experiment, you will see some pictures on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see the sequence once for a fixed time. After that, you should judge its quality by using one of the five levels of the following scale: 0x0A0x0A 5 Excellent 0x0A 4 Good 0x0A 3 Fair 0x0A 2 Poor 0x0A 1 Bad 0x0A0x0A By doing this you have the option to choose intermediate steps between the varying rating levels. Furthermore you can also pick a maximum and minimum level at the scale ends to signaling no similarity or a perfect reproduction compared to the Reference. '),(3,'acr100',' ;Bad; ;Poor; ;Fair; ;Good; ;Excellent; ',10000,0,1,1,'In this experiment, you will see some pictures on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see the sequence once for a fixed time. After that, you should judge its quality by using one of the five levels of the following scale: 0x0A0x0A 5 Excellent 0x0A 4 Good 0x0A 3 Fair 0x0A 2 Poor 0x0A 1 Bad 0x0A0x0A By doing this you have the option to choose intermediate steps between the varying rating levels. Furthermore you can also pick a maximum and minimum level at the scale ends to signaling no similarity or a perfect reproduction compared to the Reference. '),(4,'dcr5','Very annoying;Annoying;Slightly annoying;Perceptible, but not annoying;Imperceptible',10000,0,1,0,'In this experiment, you will see some picture pairs on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see first an unimpaired Reference picture without any modifications. After a fixed stimulation time, you will see an impaired version from the same picture. At the end of every pair, you should judge the quality of the second by using one of the five levels of the following scale: 0x0A0x0A 5 Imperceptible 0x0A 4 Perceptible, but not annoying 0x0A 3 Slightly annoying 0x0A 2 Annoying 0x0A 1 Very annoying 0x0A '),(5,'dcr11',' ;Very annoying; ;Annoying; ;Slightly annoying; ;Perceptible, but not annoying; ;Imperceptible; ',10000,0,1,0,'In this experiment, you will see some picture pairs on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see first an unimpaired Reference picture without any modifications. After a fixed stimulation time, you will see an impaired version from the same picture. At the end of every pair, you should judge the quality of the second by using one of the five levels of the following scale: 0x0A0x0A 5 Imperceptible 0x0A 4 Perceptible, but not annoying 0x0A 3 Slightly annoying 0x0A 2 Annoying 0x0A 1 Very annoying 0x0A0x0A By doing this you have the option to choose intermediate steps between the varying rating levels. Furthermore you can also pick a maximum and minimum level at the scale ends to signaling no similarity or a perfect reproduction compared to the Reference. '),(6,'dcr100',' ;Very annoying; ;Annoying; ;Slightly annoying; ;Perceptible, but not annoying; ;Imperceptible; ',10000,0,1,0,'In this experiment, you will see some picture pairs on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see first an unimpaired Reference picture without any modifications. After a fixed stimulation time, you will see an impaired version from the same picture. At the end of every pair, you should judge the quality of the second by using one of the five levels of the following scale: 0x0A0x0A 5 Imperceptible 0x0A 4 Perceptible, but not annoying 0x0A 3 Slightly annoying 0x0A 2 Annoying 0x0A 1 Very annoying 0x0A0x0A By doing this you have the option to choose continuous steps between the varying rating levels. '),(7,'dcr-minimal','Bad;Excellent',10000,0,1,0,'In this experiment, you will see some picture pairs on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will see first an unimpaired Reference picture without any modifications. After a fixed stimulation time, you will see an impaired version from the same picture. At the end of every pair, you should judge the quality by using a value between the following values: 0x0A0x0A 1 Bad 0x0A 2 Excellent 0x0A'),(8,'dcr-sp-5','Very annoying;Annoying;Slightly annoying;Perceptible, but not annoying;Imperceptible',10000,0,2,1,'In this experiment, you will see some picture pairs on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will always see an unimpaired Reference picture without any modifications on the left side. Next to it on the right side, you will see an impaired version from the same picture. At the end of an fixed stimulation time, you should judge the quality of the right picture by using one of the five levels of the following scale: 0x0A0x0A 5 Imperceptible 0x0A 4 Perceptible, but not annoying 0x0A 3 Slightly annoying 0x0A 2 Annoying 0x0A 1 Very annoying 0x0A'),(9,'dcr-sp-11',' ;Very annoying; ;Annoying; ;Slightly annoying; ;Perceptible, but not annoying; ;Imperceptible; ',10000,0,2,0,'In this experiment, you will see some picture pairs on the screen in front of you and we would like to ask you to rate the quality of these. Therefore, you will always see an unimpaired Reference picture without any modifications on the left side. Next to it on the right side, you will see an impaired version from the same picture. At the end of an fixed